      abstract:
        'As cidades representam a expansão populacional experimentada desde a Revolução Urbana e, com isso o crescimento urbano trouxe consigo inúmeras mudanças que impactaram, principalmente o segmento de transporte de cargas com vistas a atender as necessidades das sociedades urbanas. O objetivo central desta pesquisa consiste em instrumentalizar o segmento logístico com a criação de indicadores de desempenho e critérios capazes de apoiar o processo decisório quanto aos serviços de transporte de cargas comerciais urbanas utilizáveis. A metodologia que reveste a pesquisa ora apresentada constitui-se a partir de uma pesquisa de natureza qualitativa e de caráter descritivo com viés analítico, amparado por pesquisa bibliográfica e documental. A pesquisa mostra que se faz necessária a instituição de indicadores e observância de cenários com o estabelecimento de critérios que possam se basear nos custos, tempo de ciclo dos transportes, capacidade, qualidade de nível do serviço, uso do solo e rede viária para que o processo decisório seja mais assertivo para as organizações. Diante de realidades de transporte de cargas urbanas cada vez mais intensificadas, principalmente em ações derivadas do comércio eletrônico, os indicadores de desempenho se constituem como elementos imprescindíveis para o sucesso das operações logísticas em razão de que se faz necessária à análise e estudos mais aprofundados que evidenciem o quanto é relevante de se pensar a infraestrutura viária das cidades, considerando-se a definição de critérios e indicadores de desempenho para o âmbito dos transportes de cargas comerciais em perímetros urbanos.',
