      title:
        'O “LIMBO PREVIDENCIÁRIO” E A SEGURANÇA JURÍDICA: uma reflexão sobre o Projeto de Lei n.º 2.260/2020',
      abstract:
        'O auxílio por incapacidade temporária é concedido a quem contribuiu por, pelo menos, doze meses para a previdência social e mantém a qualidade de segurado e precisou afastar-se do trabalho por mais de quinze dias consecutivos, por motivos de saúde. Há situações em que, após alta por parte do INSS, o médico do trabalho não atesta a sua capacidade para retorno. Surge o “limbo previdenciário”, que vulnerabiliza o trabalhador diante da ausência de norma que proteja a remuneração nesse período. Tal situação gera insegurança jurídica, visto que surgem inúmeras demandas para proteger o direito à remuneração. Outrossim, tramita no Congresso o projeto de Lei n.º 2.260/2020 que visa uniformizar o entendimento sobre essa matéria. Nesta senda, questiona-se como a aprovação desse projeto contribuirá para o aumento da segurança jurídica. Esta pesquisa se justifica diante das complexas relações de trabalho mantidas na atualidade, onde doenças, a exemplo das psiquiátricas, são cada vez mais frequentes e devido a sua subjetividade benefícios podem ser suspensos indevidamente. Objetiva-se avaliar como a aprovação do PL 2.260/2020 contribuirá para o aumento da segurança jurídica a partir da discussão sobre auxílio por incapacidade temporária e as situações de “limbo”, avaliação da imprecisa legislação pátria sobre o tema e o entendimento dos tribunais e levantamento de considerações sobre segurança jurídica. É pesquisa bibliográfica, com natureza teórica, abordagem qualitativa e foi utilizado o método dedutivo. Percebeu-se que o entendimento que prevalece no TST versa que é dever do empregador reintegrar ou readaptar o funcionário que recebeu alta do INSS ou arcar com a remuneração do empregado em situações de “limbo”. Tal entendimento segue o raciocínio da alínea “a”, do inciso I, artigo 30, da Lei 11.907/2009, que trata da emissão de parecer conclusivo pelo perito da Previdência Social. O Conselho Federal de Medicina também opinou sobre o tema no Parecer de n.º 54/2015, ao expor que não há fundamento legal para que o médico do trabalho deixe de cumprir a decisão do perito-médico previdenciário. Há que se observar, ainda, que os interesses da empresa também merecem ser preservados, afinal, ela age de boa-fé atestando a incapacidade laboral de um determinado funcionário, visando a sua própria segurança. Apesar do entendimento da TNU seguir a linha de manutenção da qualidade de segurado no caso no “limbo”, há incremento nas demandas judiciais, gerando desconforto diante do ativismo judicial e insegurança jurídica que envolve a matéria. O PL retro mencionado define que o empregador pagará o salário do trabalhador, mas poderá compensá-lo com contribuições previdenciárias caso nova perícia conceda a extensão ou novo benefício. Por fim, vale destacar que a promulgação de uma lei desse tipo pode reduzir o número de demandas judiciais e aumentar a segurança jurídica nas relações de trabalho e de auxílio estatal. Havendo uma lei que balize tema tão delicado e controverso, espera-se que haja mitigação do ativismo judicial, reservando ao Poder Legislativo sua função primeira de legislar.  ',
      keywords: 'Limbo previdenciário. Regulação. Segurança jurídica.',
