      title:
        ' A Convenção de Haia no caso Sean Goldman: uma análise do Recurso Especial no. 900.262/RJ',
      abstract:
        'Filho de uma brasileira e de um americano, Sean Richard Goldman nasceu nos Estados Unidos e veio passar férias no Brasil com a sua mãe. Durante as férias a sua mãe, Bruna Bianchi informou ao seu pai, David George Goldman, que não retornaria aos Estados Unidos e desejava o fim do casamento. A guarda de Sean foi concedida exclusivamente à sua mãe, violando a Convenção de Haia. David George recorreu ao judiciário estadunidense pleiteando a guarda do filho e teve o seu pedido julgado procedente, com os Estados Unidos emitindo uma ordem de devolução da criança, a qual não foi cumprida. Assim, visando reaver a guarda do filho com base na Convenção, David ingressou com uma ação na justiça brasileira, a qual foi julgada improcedente em 1a e 2a instância com base no princípio do superior interesse da criança. Bruna Bianchi veio a falecer por complicações no parto da sua segunda filha e David George passou a ser o único genitor vivo. Contudo, o padrasto de Sean ajuizou uma ação de reconhecimento de paternidade socioafetiva cumulada com ação de guarda, a qual foi julgada procedente em sede liminar. Diante da situação David acionou o governo dos Estados Unidos. O governo americano enviou um pedido de Cooperação interjurisdicional à autoridade Central do Brasil, pedindo o retorno de Sean ao país. Após as decisões judiciais pertinentes, a criança retornou para os Estados Unidos sob a guarda do pai.\nEntre as muitas decisões judiciais proferidas no processo, é interessante analisar, no entanto, a do Recurso Especial no 900262/RJ do Superior Tribunal de Justiça, uma vez que essa muito se caracteriza pela ricas discussões a respeito da aplicação da Convenção de Haia sobre os Aspectos Civis do Sequestro Internacional de Crianças de 1980. Foi realizada uma pesquisa qualitativa a partir da análise do acórdão do Resp. 900262/RJ, da Convenção de Haia sobre Sequestro Internacional de Crianças, dissertações, legislações, artigos e doutrina. Busca-se analisar a aplicação da Convenção de Haia os Aspectos Civis do Sequestro Internacional de Crianças de 1980 na decisão do Recurso Especial no 900262/RJ, julgado pela terceira turma e de relatoria da Ministra Nancy Andrighi.',
      keywords:
        'Direito Internacional. Jurisdição. Sequestro Internacional de Crianças. Jurisprudência. Superior Tribunal de Justiça.',
