      title:
        'A aplicação do Código de Defesa do Consumidor na responsabilidade civil de empresas de transporte aéreo internacional nas hipóteses de danos morais',
      abstract:
        'O presente trabalho tem como objetivo analisar as normas jurídicas aplicáveis na responsabilidade civil de empresas de transporte aéreo internacional com relação aos consumidores. Examina-se os julgados RE 636331 e RE 1394401 do STF, tendo em vista a antinomia aparente entre o Código de Defesa do Consumidor e a Convenção de Montreal, já que o primeiro diploma legal não prevê limitação de indenização ao consumidor, enquanto a referida convenção internacional prevê limitação de indenização nos casos de dano material (perda, avaria ou extravio de bagagens e cargas). O trabalho trata-se de pesquisa documental (análise de legislação e de julgados do STF), de cunho descritivo. Conclui-se que, conforme jurisprudência do STF, aplica-se a Convenção de Montreal em se tratando de dano material, limitando-se o valor da indenização. Por sua vez, em se tratando de danos morais, aplica-se o Código de Defesa do Consumidor, sem limitação prevista quanto ao valor da indenização. ',
