      abstract:
        'O presente trabalho é fruto de uma visita técnica realizada às instalações da AMBEV, localizada no Estado de Pernambuco, que foi uma atividade desenvolvida na disciplina de Contabilidade de Custos, no semestre 2023.1 A AMBEV é uma empresa brasileira que fabrica bebidas desde 1999, sendo uma das maiores empresas do país, controlando a maior parte do mercado de fabricação de bebidas e possuindo uma das maiores receitas líquidas do Brasil. A AMBEV faz parte do grupo Anheuser-Busch InBev, o atual maior fabricante de cervejas do mundo. Foi criada em 1999, a partir da junção entre as rivais, a Companhia Antarctica Paulista e a Companhia Cervejaria Brahma do Rio de Janeiro. Atualmente, tem mais de 30 cervejarias, maltarias, fábricas de refrigerante, rótulos, rolha e vidro, além de seis centros de excelência espalhados pelo Brasil. É conhecida por produzir mais de 25 rótulos de cervejas pilsen, como Skol, Brahma e Budweiser, e cerca de 50 do tipo ale, as mais consumidas pelos brasileiros. O objetivo principal desse trabalho é identificar os elementos de custos da produção conjunta na fábrica da AMBEV Pernambuco.',
