      title:
        'UNIFICANDO A DUPLA JORNADA: A DISPARIDADE DE GÊNERO DURANTE O TRABALHO REMOTO NO SERIDÓ POTIGUAR',
      abstract:
        'O estudo explora a disparidade de gênero no contexto do trabalho remoto durante a pandemia COVID-19 no Seridó Potiguar. Através de questionários qualitativos com 40 respondentes, identificou-se que as mulheres, mais do que os homens, enfrentaram o desafio de equilibrar as tarefas domésticas e profissionais. A maioria das mulheres (65%) cuidou dos filhos enquanto trabalhava e/ou estudava de maneira remota, contra 30% dos homens. Similarmente, 65% das mulheres sentiram-se pressionadas a priorizar as atividades domésticas no período remoto, enquanto apenas 30% dos homens sentiram o mesmo. Além disso, 65% das mulheres ultrapassaram a jornada diária de trabalho, comparado a 30% dos homens. Esses resultados indicam que o trabalho remoto, ao invadir o espaço doméstico, intensifica a pressão da dupla jornada para as mulheres, reforçando papéis de gênero tradicionais e aumentando a disparidade de gênero',
