      title:
        'EPIDEMIAS DE DENGUE NO BRASIL: Uma análise do cenário informacional',
      abstract:
        'Analisar o comportamento informacional da sociedade mediante as epidemias de arboviroses, como a dengue é de relevância para compreender como a sociedade busca, acessa e usa as informações para que dessa forma seja possível trilhar estratégias de políticas públicas que contribuam com o controle e prevenção dessa doença. Este estudo objetiva analisar os padrões de comportamento da sociedade brasileira durante a epidemia de dengue em 2022 por meio da tríade da quantidade de notícias publicadas sobre a doença, percentual de buscas pelo termo dengue no Google e a quantidade de casos notificados da doença no Brasil. Para tanto, utilizou-se como metodologia um estudo de pesquisa quantitativa e aplicada que emprega uma abordagem webmétrica para extração de dados e suas metas são exploratórias e descritivas. Os resultados mostram que em 2022, há uma relação intrínseca entre os casos notificados e as buscas relacionadas à dengue, com o crescimento das pesquisas na internet acompanhando o aumento das notificações da doença. Mesmo após medidas de controle nos meses seguintes aos picos, a sociedade mantém o interesse por informações sobre a dengue. Além disso, constata-se que as notícias publicadas pelas mídias são poucas e que não causam impacto direto no comportamento da sociedade em relação à doença. Conclui-se a efetividade da pesquisa e depreende-se que os estudos métricos podem ser utilizados para análises de comportamento informacional e desenvolvimento de estratégias preventivas em relação às epidemias de dengue no país.',
      keywords:
        'Dengue. Arbovirose. Comportamento Informacional. Webmetria. Facebook.',
