      title: 'O LEGÍTIMO INTERESSE E A LEI GERAL DE PROTEÇÃO DE DADOS',
      abstract:
        'Contemporaneamente, fornecer dados pessoais como nome completo, CPF, dentre outros, tornou-se rotineiro e algo aparentemente banal e sem consequências. Com um clique, é possível consentir com os Termos de Uso, mesmo sem ler ou ter uma compreensão do real uso das informações pelo controlador ou operador dos dados. Tais figuras são previstas no art. 5°, VI e VII da Lei n.° 13.709/2018, intitulada Lei Geral de Proteção de Dados (LGPD), que visa regulamentar e proteger os dados das pessoas físicas em ambientes como a internet. Assim, a ação rotineira de fornecer um documento que será registrado, por exemplo, no cadastro de farmácias, já incute responsabilidade para o detentor de tais informações.',
