      _id: '64c80d1aea39bd00105db5d6',
      title: 'TRABALHO INFANTIL RURAL: um estudo a partir da análise marxista',
      abstract:
        'O presente estudo se propõe a analisar o trabalho infantil rural sob a perspectiva da teoria marxista, assim, é necessário compreender se o sistema capitalista é agente perpetuador da exploração do trabalho infantil e se há a obtenção de mais-valia a partir dessa prática de trabalho. Dessa forma, busca-se investigar os fatores estruturais, econômicos e sociais que contribuem para a exploração de crianças nesse contexto, considerando o trabalho explorado como uma forma subalterna direcionada às crianças e aos adolescentes da classe trabalhadora. A metodologia de estudo utilizada partiu da abordagem bibliográfica, baseando-se em materiais já publicados, como teses, dissertações e artigos científicos, bem como utilizou-se do método dedutivo. Conforme dados da OIT, o trabalho infantil é predominante nas áreas rurais. Nesses dados, revela-se 122,7 milhões de crianças e adolescentes em situação de trabalho infantil em áreas rurais contra 37,3 milhões em áreas urbanas. Ainda, de acordo com dados da PNAD 2015, o dobro de meninos e meninas residentes rurais sofrem violações de direitos assegurados, dessa maneira, enfrentam mais privações em relação aos que vivem nas cidades. De acordo com a teoria marxista, a capacidade de trabalho é um recurso valioso para o capitalista, visto que o valor decorre do trabalho humano. Marx também destacou que o trabalho infantil esteve associado à precariedade desde o início da industrialização. Assim, o modo de produção capitalista explora a força de trabalho de crianças com fins lucrativos. De tal modo, conclui-se que o trabalho infantil é um fenômeno complexo que evidencia a desvalorização do trabalho na sociedade contemporânea. Embora gere valor econômico ao sistema que está inserido, o trabalho infantil rural é tratado como um não-valor.',
      keywords: 'Trabalho infantil; Mais-valia; Exploração.',
      thematicGroup: {
        _id: '64907d1f5995d60010a1e572',
        entity: 'thematicgroups',
        data: {
          coordinators: [
            {
              _id: '5aaabd006d0f3d000fe6f4a9',
              email: 'adv.andersonss@gmail.com',
              name: 'Anderson Souza da Silva Lanzillo',
            },
          ],
          _id: '64907d1f5995d60010a1e571',
          name: 'Direitos sociais na contemporaneidade\n(Direto do Trabalho; Seguridade; Assistência Social)',
          description:
            'A sociedade capitalista moderna e as relações sociais que ela engendra têm colocado várias questões e desafios para o estabelecimento, proteção e garantia de direitos sociais. Antes amparados em uma concepção de estado de Bem-estar Social e de relações de solidariedade, o Estado atual na feição neoliberal põe a primazia do indivíduo muitas vezes em detrimento social, o que tem impactado e transfigurado os direitos sociais (reforma trabalhista, reforma da previdência e seguridade social, precarização das relações de trabalho). Diante disto, este GT quer discutir a situação dos direitos sociais face ao contexto atual, especialmente temas como a precarização das relações do trabalho, a luta pelo trabalho decente, combate ao trabalho infantil e ao assédio, a proteção constitucional do trabalhador e os direitos assistenciais.',
          area: {
            _id: '649084c5e6bcd204d9504b0d',
            name: 'Direito Privado e Público',
          },
        },
      },
