      abstract:
        'O pôster relata a experiência de uma caminhada histórica no centro de Natal, na qual alunos de biblioteconomia relataram suas experiências vivenciadas. Ao se conectarem com a história da cidade, eles compreenderam como a história local é parte integrante de suas próprias histórias individuais. Durante a caminhada, foram explanados os acontecimentos históricos mais importantes dos locais visitados ressaltando desenvolvimento da cidade desde sua origem colonial até a modernidade .A atividade revelou-se uma ferramenta educacional valiosa, para consolidação do senso de pertencimento e a valorização do patrimônio cultural, fortalecendo a identidade cidadã dos participantes. O pôster destaca a importância dessa experiência autêntica para a compreensão da história local e enfatiza que lições aprendidas vão além do campo teórico, proporcionando um conhecimento significativo e duradouro.',
