      title:
        'PERCEPÇÃO DOS DISCENTES DA DISCIPLINA DE MATEMÁTICA FINANCEIRA DO CURSO DE CIÊNCIAS CONTÁBEIS DA UFRN SOBRE A IMPORT NCIA DA MONITORIA.',
      abstract:
        'INTRODUÇÃO: No decurso da vida acadêmica, diversas atividades estão disponíveis para os discentes das IES. Estas visam imergir os alunos no ambiente acadêmico e instigar aptidões docentes, de pesquisa e extensão. Assim, a monitoria integra essas atividades, onde o monitor pode aproximar-se da carreira docente, além de fornecer ferramentas para que os demais alunos sob tutoria possam ter maior suporte no processo ensino-aprendizagem, auxiliado na resolução de problemas, redução de dúvidas, e acompanhamento mais próximo durante todo o decurso da disciplina. A matemática financeira é de extrema importância para a formação de profissionais e cidadãos conscientes (Teixeira, 2015). Apesar do grande peso desta disciplina para a formação profissional do contador, muitos dos alunos dela não conseguem aprovação, fazendo com que a disciplina seja um dos gargalos para atrasos ou desistência do curso de Ciências Contábeis na UFRN. Com isso, esse trabalho tem o objetivo analisar a percepção dos discentes da disciplina de matemática financeira do curso de ciências contábeis da UFRN sobre a prática da monitoria desta disciplina, buscando avaliar as possíveis contribuições da atividade no desempenho dos discentes atendidos. METODOLOGIA: Durante todo o semestre de 2023.1 foram disponibilizados horários de atendimento da monitoria nos horários das 10h50 às 12h30 e das 16h50 às 18h30, de segunda a sexta. Atendimentos via WhatsApp eram realizados diariamente, além de alguns encontros virtuais via Google Meet durante a semana e finais de semana (quando possível). Sob sugestão da monitoria, também, foi solicitada a entrega (opcional) da resolução das listas de exercícios, a qual seria fornecido pontuação adicional àqueles que optassem pela entrega. Ao final do semestre, na última semana de aula, foi disponibilizado um questionário virtual, pelo google formulários, onde os alunos foram questionados sobre 12 quesitos, incluindo turno em que cursou a disciplina, frequência na qual participou da monitoria, percepção sobre a importância desta e das listas, expectativas, e sugestões. RESULTADOS: Foram obtidas 28 respostas ao formulário de avaliação da monitoria Destes, 57 1 eram de discentes da turma da manhã, e 42 9 do noturno Todos os que responderam acreditam que a monitoria pode colaborar com seu desenvolvimento acadêmico dado semelhante ao encontrado Souza et al 2018 apesar disto, apenas 67 9 participou de alguma forma das atividades de monitoria Em relação às expectativas, 75 dos alunos esperavam que a monitoria auxiliasse na resolução de questões Dentre as respostas obtidas, 57 1 acreditam que as expectativas foram completamente atendidas Dentre as sugestões para a melhoria da disciplina citadas, as principais foram monitoria remota (via Meet), com 50 de citações, maior divulgação, com 32 1 e mais horários e monitorias nos finais de semana, com 25 de citações cada Os resultados corroboram com o encontrado por Quirino et al 2010 porém, tendo em vista a realidade pós pandemia e a possibilidade de atendimentos remotos, neste quesito, o presente trabalho apresentou esta como a principal sugestão para melhoria da monitoria. CONCLUSÃO: Esta pesquisa buscou expor as percepções dos discentes de matemática financeira do curso de ciências contábeis sobre a monitoria e sua importância para o processo ensino-aprendizagem. Mesmo com uma amostra limitada, demonstrou-se a crença na importância da monitoria e seu impacto no aprendizado dos alunos. Tendo em vista a realidade onde muitos dos estudantes trabalham e possuem limitações de horários, os encontros presenciais necessitam ter seus horários revistos, com possíveis atendimentos durante os finais de semana, em horários de almoço ou intervalo, onde mais discentes possam participar, mesmo que virtualmente. A prática é fundamental para o aprendizado em Matemática Financeira, assim, a entrega das listas de exercícios resolvidas pode se tornar uma atividade permanente, tendo em vista que os alunos atribuem parte do seu desempenho às mesmas.',
      keywords:
        'monitoria; matemática financeira; processo ensino-aprendizagem.',
