      title:
        'ANÁLISE ECONÔMICA DA EXTRAFISCALIDADE DO IPI SOBRE A INDÚSTRIA TABAGISTA BRASILEIRA: EXTERNALIDADES NEGATIVAS E INCENTIVO AO CRIME ORGANIZADO',
      abstract:
        'A Convenção-Quadro para o Controle do Tabaco (CQCT) possui o objetivo de assegurar o direito à saúde e ao bem-estar. Destaca-se que o tabagismo é um fator de risco para a qualidade de vida saudável e representa custos econômicos na saúde pública. Uma estratégia adotada no Brasil para reduzir o consumo e custear os prejuízos é a elevação da alíquota do Imposto sobre Produtos Industrializados (IPI) sobre a indústria do tabaco. Essa política tributária torna-se possível em decorrência da característica extrafiscal do IPI, que além da função arrecadatória, visa, primordialmente, ao interesse público, induzindo ou desestimulando comportamentos. Nesse sentido, o presente estudo objetiva verificar se o IPI-Cigarro está cumprindo efetivamente seu propósito orientado ao interesse público, uma vez que o aumento do preço do cigarro legal pode incentivar o contrabando de cigarros para o país. A metodologia utilizada assume caráter explicativo, com método dedutivo e baseia-se em pesquisas bibliográficas, especialmente, acerca da Teoria Econômica do Crime e Expansão do Direito Penal. Assim, foi verificado que, ao elevar o preço do cigarro legal, os consumidores podem procurar alternativas mais baratas, como o cigarro contrabandeado, que oferece maior conveniência e perspectivas de lucro aos contrabandistas. Logo, partindo da análise racional do custo-benefício proporcionado, aumentar o IPI-Cigarro para, a priori, diminuir a prevalência dos cigarros e fornecer receitas para financiamento dos custos associados ao fumo estimula, em contrapartida, o contrabando, pois o valor do cigarro vendido ilicitamente sempre será menor se comparado ao preço daquele vendido no mercado legal. É possível chegar à conclusão, sob a visão da economia do crime, que a incidência tributária do IPI-Cigarro não cumpre com sua finalidade orientada ao interesse público, minando os efeitos pretendidos pela CQCT, além de gerar externalidades negativas, haja vista que o mercado ilícito está intrinsicamente relacionado à evasão fiscal, associações criminosas internacionais, dentre outros delitos, tornando-se evidente que diversos setores da sociedade, por exemplo a economia, segurança e desenvolvimento nacional, são impactados negativamente. Ademais, a ausência de fiscalização de controle de qualidade potencializa o risco a saúde de quem consome o cigarro contrabandeado, acarretando um efeito reverso para o próprio sistema de saúde.',
      keywords:
        'Saúde; IPI; indústria do tabaco; contrabando; Teoria econômica do Crime. ',
