      abstract:
        'O pôster apresenta a Associação de Maricultura e Beneficiamento de Algas de Pitangui (AMBAP), e o acompanhamento realizado pela extensão universitária através da Incubadora de Iniciativas e Empreendimentos Solidários (INICIES), que presta assessoria ao grupo, visando colaborar com a reestruturação da associação, que assim como muitos segmentos da classe trabalhadora, sofreu com a pandemia da Covid-19. A AMBAP é uma organização de mulheres que utiliza o beneficiamento de algas marinhas como ação produtiva e de geração de renda, residentes na praia de Pitangui, localizada no Município de Extremoz/RN. A elaboração do pôster contou com a orientação da Profa. Dra.  Ilena Felipe Barros, professora do Departamento de Serviço Social da Universidade Federal do Rio Grande do Norte e do Prof. Dr. Roberto Marinho Alves da Silva, professor do Departamento de Serviço Social da Universidade Federal do Rio Grande do Norte, ambos, coordenador/a da Incubadora de Iniciativas e Empreendimentos Solidários.',
