      title: 'DEEP FAKES: Breve análise à luz dos direitos da personalidade',
      abstract:
        'Entendem-se por direitos da personalidade os atributos humanos que demandam relevante atenção no campo das relações privadas. Dentre os tipos de direito inerentes à personalidade existe o direito à imagem, garantia de livre expressão da subjetividade pelas representações, fotografias, caracterizações ou assemelhados, sem que outros possam intervir ou valer-se dela como convir. Inserido no contexto das novas tecnologias, o presente trabalho busca associar o fenômeno das deep fakes, imagens ou vídeos falsos criados a partir da Inteligência Artificial, à violação aos direitos da personalidade. Considerando a relevância da temática no contexto eleitoral, a utilização das deep fakes nas últimas eleições brasileiras foi um fenômeno que não passou despercebido pelos tribunais brasileiros, especialmente pelo Tribunal Superior Eleitoral. Tendo em vista a ameaça que as deep fakes apresentam aos direitos da personalidade, pretende-se analisar quais as medidas adotadas pelo direito brasileiro para combater os efeitos negativos das deep fakes. Para isso, embasa-se em estudo de caso envolvendo a manipulação de vídeos para desprestigiar a candidatura do atual Presidente Lula, no contexto das eleições de 2022. \n',
      keywords: ' Deep Fakes; Direitos da Personalidade; Eleições.',
