      title:
        'ANÁLISE DO DESCARTE DE RESÍDUOS: O CASO DA UFRN E O PAPEL DO CONTADOR',
      abstract:
        'A pesquisa em questão tem como objetivo o levantamento de variáveis referente a temática do descarte de lixo na UFRN, com o intuito de contribuir para o desenvolvimento de estratégias por parte da instituição, no tocante a conscientização do público sobre o descarte correto do lixo.\nDiante do exposto, surge a seguinte questão- problema: Os discentes e docentes praticam o descarte consciente na UFRN?\nA pesquisa foi classificada como sendo descritiva, quanto aos objetivos; Estudo de caso e levantamento quanto aos procedimentos, com abordagem qualitativa. A coleta de dados se deu através de um questionário, realizado com 128 discentes e 11 discentes.\nOs resultados encontraram que apesar de apenas 38,1% utilizarem de forma correta a lixeira, 77,7% responderam que se preocupam em descartar seu lixo de forma correta. E quando questionados se haveria maior conhecimento sobre coleta seletiva, 95% afirma que faria um descarte de forma mais correta. Outro ponto questionado foi sobre a separação de lixo orgânico e não orgânico em suas residências, e 70,5% responderam que não faziam esse tipo de separação.',
