      abstract:
        'Diante do exposto, a pesquisa teve como objetivo identificar as práticas ESG nos campos, social, ambiental e governamental, desenvolvidas pela Empresa JBS e seus impactos.\nA pesquisa foi classificada como sendo descritiva, quanto aos objetivos; Estudo de caso e documental quanto aos procedimentos, com abordagem qualitativa. A empresa foi escolhida por ser classificada como potencialmente poluidora e ser uma atividade propícia a grandes impactos ambientais. A coleta de dados se deu através de documentos (demonstrações contábeis, relatório administrativo e relatório de sustentabilidade) referente ao ano de 2021, publicados na aba de sustentabilidade dentro do site da JBS.\nAtravés desta pesquisa Identificamos os principais custos que a JBS tem ligados a sua sustentabilidade, gestão de resíduos e prevenção de danos ambientais, mas também foi possível identificar como essa empresa consegue fazer com que as práticas ambientais tragam um retorno positivo à empresa.\n',
