      title:
        'AS TESES APRESENTADAS NO JULGAMENTO DA ADI 1625: uma análise da (im)possibilidade jurídica de denúncia unilateral de tratados internacionais',
      abstract:
        'A problemática da denúncia de tratados internacionais  enfrenta uma série de divergências quanto à posição a adotada pelo ordenamento jurídico brasileiro. Isso porque a CRFB/88 não foi clara quanto ao procedimento a ser seguido e à necessidade de participação dos Poderes Executivo e Legislativo. Nesse sentido, após a denúncia da Convenção n.º 158 da OIT, por ato unilateral do então Presidente da República, a questão foi levada ao Supremo Tribunal Federal (STF) por meio da ADI nº 1625, processo no qual os ministros apresentaram diferentes posicionamentos sobre o tema.',
