      title:
        'O AUMENTO DO NÚMERO DE CASOS DE TRABALHO INFANTIL NO BRASIL EM DECORRÊNCIA DA PANDEMIA DO COVID-19',
      abstract:
        'Dentre tantas consequências que a pandemia do covid 19 trouxe a sociedade, o aumento do trabalho infantil se caracteriza como um gravame que precisa ser combatido. Em escala global, dados da UNICEF de 2021, revelam que houve um aumento do trabalho infantil de 8,4 milhões entre meninas e meninos nos últimos quatro anos, de 2016 a 2020, representando um valor de 160 milhões de crianças no mundo todo. Em razão disso, é oportuno e crucial um estudo desse problema no cenário brasileiro, portanto, o presente trabalho visa analisar, bem como refletir a respeito das causas que acarretaram nesse agravamento.\n',
      keywords: ' Trabalho, Crianças, Pandemia, Infantil',
      thematicGroup: {
        _id: '64907d1f5995d60010a1e572',
        entity: 'thematicgroups',
        data: {
          coordinators: [
            {
              _id: '5aaabd006d0f3d000fe6f4a9',
              email: 'adv.andersonss@gmail.com',
              name: 'Anderson Souza da Silva Lanzillo',
            },
          ],
          _id: '64907d1f5995d60010a1e571',
          name: 'Direitos sociais na contemporaneidade\n(Direto do Trabalho; Seguridade; Assistência Social)',
          description:
            'A sociedade capitalista moderna e as relações sociais que ela engendra têm colocado várias questões e desafios para o estabelecimento, proteção e garantia de direitos sociais. Antes amparados em uma concepção de estado de Bem-estar Social e de relações de solidariedade, o Estado atual na feição neoliberal põe a primazia do indivíduo muitas vezes em detrimento social, o que tem impactado e transfigurado os direitos sociais (reforma trabalhista, reforma da previdência e seguridade social, precarização das relações de trabalho). Diante disto, este GT quer discutir a situação dos direitos sociais face ao contexto atual, especialmente temas como a precarização das relações do trabalho, a luta pelo trabalho decente, combate ao trabalho infantil e ao assédio, a proteção constitucional do trabalhador e os direitos assistenciais.',
          area: {
            _id: '649084c5e6bcd204d9504b0d',
            name: 'Direito Privado e Público',
          },
        },
      },
