      title:
        'CASO ELIS REGINA E VW: uma análise dos limites jurídicos ao uso de Inteligências Artificiais Gerativas',
      abstract:
        'O presente trabalho realizou uma análise normativa, através de revisão bibliográfica, quanto à legalidade da manipulação da imagem de uma pessoa falecida, e sua posterior utilização em produção audiovisual inédita, sob a ótica do "Caso Elis Regina e VW" e da legislação brasileira de direitos da personalidade (art. 11-21 do CC) e direito autoral (Lei nº 9.610/1998). Dessa forma, observou-se que, na ausência de legislação específica, deve-se manter a regra de intransmissibilidade dos direitos de personalidade, entre eles o direito de imagem, impossibilitando essa espécie de produção no contexto em questão. Quanto ao direito autoral, se parece que não é possível atribuir autoria à produção original de IA, conforme a interpretação da legislação atual. Por fim, compreende-se há uma nítida lacuna no ordenamento jurídico brasileiro quanto à regulação de inteligência artificial, e que, embora haja a tramitação do PL nº 2338/2023 (Marco Regulatório da IA), este, na forma em que está, ainda não é suficiente para preencher essas lacunas e deve ser aperfeiçoado para tal.',
      keywords:
        'INTELIGÊNCIA ARTIFICIAL; DIREITOS DA PERSONALIDADE; DIREITO AUTORAL; DIREITO DE IMAGEM.',
