      title:
        'GASTRONOMIA COMO MANIFESTAÇÃO DA CULTURA: Um  estudo dos elementos representativos de Natal',
      abstract:
        'Segundo Castro, Maciel e Maciel (2016), a comida é cultura, e todos os grupos\nhumanos tem sua cultura que se manifesta no que se come e como se come.\nQuando valorizada, a gastronomia fortalece a atividade turística, porém sua promoção deve ser alinhada a identidade cultural da população local. Neste sentido, o presente estudo tem como objetivo analisar os elementos representativos da gastronomia de Natal sob a ótica de seus residentes. Para isso, foi utilizada uma metodologia quali-quantitativa com as técnicas de entrevista com especialistas e grupo focal com residentes. Além disso, uma pesquisa Survey foi efetivada  com 707 residentes da cidade. Os dados foram analisados com análise de conteúdo e estatística descritiva. Os resultados mostraram que a Ginga com Tapioca foi o elemento mais representativo da cidade. Conclui-se que ao promover o turismo gastronômico a partir da Ginga com Tapioca, Natal estará fomentando o turismo alinhado a memória local, além de fortalecer a atividade em áreas menos favorecidas pelo turismo, como a Zona Norte da cidade.',
