      abstract:
        'Por meio de uma abordagem bibliográfica, o presente trabalho busca abordar os desafios impostos pelo avanço acelerado da inteligência artificial, a qual tem sido utilizada por criminosos para disseminar pornografia infantil, principalmente por meio das deepfakes. Assim, o estudo objetiva analisar a capacidade do direito digital em lidar com desafios dessa magnitude, levando em conta aspectos jurídicos e de inovação tecnológica. Como resultado, observou-se que legislações fundamentais, como o ECA e as diretrizes do Código Penal, não cobrem completamente as demandas deste combate. Isso se deve ao fato de que, no Brasil, ainda não existem mecanismos eficazes para prevenir o uso indevido da inteligência artificial.',
