      abstract:
        'Em 2021, o Conselho Nacional da Justiça (CNJ) instituiu o protocolo para julgamento com perspectiva de gênero, importante documento que tem fundamentado decisões do judiciário no âmbito do Direito Previdenciário em prol dos direitos das mulheres. Dessa forma, como objetivo geral, busca-se destacar a importância do julgamento com perspectiva de gênero, especialmente no direito previdenciário, como forma de proteção dos direitos das mulheres. Já como objetivos específicos, tem-se compreender o que se entende por perspectiva de gênero, bem como analisar decisões no âmbito previdenciário sobre a temática.  Para tanto, utilizou-se de revisão bibliográfica, além da análise documental do Protocolo do CNJ e de decisões judiciais, como instrumentos metodológicos. Concluindo-se pela extrema relevância do referido protocolo como ferramenta de proteção e garantia dos direitos femininos no âmbito previdenciário. ',
