      title:
        'AS INTELIGÊNCIAS ARTIFICIAIS APLICADAS NA ADVOCACIA PÚBLICA: uma concretização do princípio constitucional da eficiência',
      abstract:
        'O art. 37, caput, da Constituição Federal de 1988 estabelece os princípios básicos da administração pública: legalidade, impessoalidade, moralidade, publicidade e eficiência. O princípio da eficiência se destaca, preceituando que a função administrativa deve buscar utilizar de maneira proveitosa os recursos disponíveis, de modo a alcançar os resultados mais favoráveis e satisfazer as necessidades da sociedade da maneira mais eficaz e econômica possível. Esses princípios devem ser observados, também, pela advocacia pública, na medida em que esta representa os entes políticos e desempenha atividades de consultoria e assessoramento jurídico do Poder Executivo, como preconizado no art. 131. Entretanto, quando da defesa dos entes públicos, constata-se uma aparente dificuldade na obtenção de informações que a subsidiem as operações das procuradorias do país. Nesse contexto, grandes investimentos tecnológicos estão sendo realizados nas procuradorias em inteligências artificiais: no campo jurídico da Administração Pública, ressalta-se o Sistema AGU de Inteligência Jurídica (SAPIENS), da Advocacia-Geral da União, e o Dra. Luzia, da Procuradoria-Geral do Distrito Federal. Esses sistemas de inteligência artificial dão maior celeridade ao andamento e à resolução dos processos, contribuindo, assim, para a efetivação do princípio constitucional da eficiência. Partindo disso, o presente trabalho intenta identificar os possíveis impactos do uso da inteligência artificial pela Advocacia Pública.',
      keywords:
        'Advocacia pública. Inteligência artificial. Procuradorias. Princípio da eficiência.',
