      abstract:
        'O presente trabalho tem como objetivo apresentar a conduta do governo chinês quanto aos norte-coreanos que por lá buscam refúgio, os quais atravessam a fronteira da China em busca de melhores condições de vida. É uma análise à luz da Convenção de Genebra de 1951 e o Protocolo de 1967, sendo ambos ratificados pela China. Dessa forma, este trabalho tem precisamente o intuito de averiguar a conduta da China em relação às regras e normas que constam no Direito Internacional Privado no que concerne aos direitos dos refugiados.\n\n',
