      title: 'Desaparecimento Forçado de pessoas no caso da Chacina de Acari',
      abstract:
        'A prática do desaparecimento forçado de pessoas, conforme estândares interamericanos, é delimitada como crime continuado e pluriofensivo, em que o Estado tem o dever de investigar os fatos e punir os responsáveis. No entanto, a irresolução do caso da Chacina de Acari e a subsequente submissão da ação para a apreciação pela Corte Interamericana de Direitos Humanos, ressalta o descaso por parte do Estado brasileiro com mais uma situação de desaparecimento forçado ocorrida no país. Com efeito, o estudo assente a necessidade de uma condenação firme frente a persistência da posição omissa e conivente do Brasil com circunstâncias de desaparecimento forçado de pessoas ocorridas no país.',
