      title:
        'O USO EXESSIVO DA FORÇA ESTATAL: Caso Favela Nova Brasília vs. Brasil como parâmetro de controle de convencionalidade pelo Supremo Tribunal Federal',
      abstract:
        'O Brasil reconheceu a competência jurisdicional contenciosa da Corte Interamericana de Direitos Humanos (Corte IDH) em 10 de dezembro de 1998, se propondo a empregar as decisões da Corte IDH  no direito interno brasileiro. Uma dessas decisões foi proferida em 2017, no Caso Favela Nova Brasília vs. Brasil, em que  a Corte IDH considerou o Estado culpado pela omissão, impunidade dos autores e ausência de ações reparatórias em favor das vítimas de operações realizadas pela Polícia Civil do Rio de Janeiro. Nesse sentido, surge o questionamento: em quais decisões o Supremo Tribunal Federal (STF)  empregou o caso Favela Nova Brasília vs. Brasil como parâmetro para controle de convencionalidade? Com o objetivo de responder a problemática, foi realizada uma pesquisa jurisprudencial no site oficial do STF e posteriormente uma análise dos julgados que utilizaram o caso em comento como parâmetro de controle de convencionalidade. Espera-se que o presente trabalho sirva como comparativo ao longo dos anos, instigando outros alunos a analisar e fiscalizar o controle de convencionalidade pelo sistema jurídico brasileiro.',
